import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { api } from "../api";

export default function Dashboard() {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const loadProjects = async () => {
    try {
      const res = await api.get("/projects");
      setProjects(res.data);
    } catch (err) {
      console.error(err);
      setError(err.response?.data?.detail || "Failed to load projects");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadProjects();
  }, []);

  return (
    <div className="container">
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: 25 }}>
        <h2>Your Projects</h2>
        <button className="btn" onClick={() => navigate("/projects/new")}>
          + New Project
        </button>
      </div>

      {loading && <p>Loading your projects...</p>}
      {error && <p style={{ color: "red", marginBottom: 20 }}>{error}</p>}

      {projects.length === 0 && !loading && (
        <p style={{ marginTop: 20, color: "#666" }}>
          No projects yet â€” click <b>+ New Project</b> to create one.
        </p>
      )}

      {projects.map((p) => (
        <div className="card" key={p.id}>
          <div>
            <strong style={{ fontSize: 17 }}>{p.title}</strong>{" "}
            <span className="badge">{p.doc_type}</span>
          </div>
          <button
            className="btn"
            onClick={() => navigate(`/projects/${p.id}/edit`)}
          >
            Open
          </button>
        </div>
      ))}
    </div>
  );
}
